        super(props)
        this.ref = firebase.database().ref('products');
        this.state = {
            products : []
        }
    }
    handleClick() {
        this.ref.once('value').then((s)=>console.log(s.val()));
    }
    render() {
        return (
            <div>
                <h1>products work</h1>
                <button onClick={()=>this.handleClick()}>Test</button>
            </div>
        );
    }
}

export  default Products;
